import React, { Component } from 'react';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import "./css/styles.css";
import "./css/w3schools.css";

export default class Education extends Component {
  render() {
    return (
      <div>
      <h3 class="main montserrat large"> EDUCATION </h3>
      <Card class="mai card">
        <CardContent>
          <h3 class="montserrat">Harvard University </h3>
          <h4 class="montserrat">A.B. in Computer Science</h4>
          <h4 class="montserrat">Class of 2023</h4>
          <p class="montserrat">Courses including CS50, AM22a, CS51, CS20</p>
        </CardContent>
      </Card>
      <Card class="main card">
        <CardContent>
          <h3 class="montserrat">Oak Knoll School</h3>
          <h4 class="montserrat">Class of 2019</h4>
          <p class="montserrat">Cum Laude Society, High Honors, National AP Scholar, Holy Child Spirit Award, Girl Scout Gold Award</p>
          <br/>
        </CardContent>
      </Card>
      </div>
    )
  }
}

